    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT col0 IN ( + 66 + 26, - col2 / col1 + col1 + 37 * ( - 53 ) - + col1 );
  - name: tab1

outputs:
  - name: q9764.out
    data: |
      51	14	96
      85	5	59
      91	47	68
